import React from 'react';

const fetchedPlaylist = [];

// mock api request
export const fetchPlaylist = () => {
	return new Promise((res, rej) => {
		setTimeout(() => res(fetchedPlaylist), 1000);
	});
};

export const PlaylistContext = React.createContext();
